[[package]]
name = "colormath"
version = "3.0.0"
description = "Color math and conversion library."
category = "main"
optional = true
python-versions = "*"

[package.dependencies]
networkx = ">=2.0"
numpy = "*"

[[package]]
name = "mypy"
version = "0.971"
description = "Optional static typing for Python"
category = "dev"
optional = false
python-versions = ">=3.6"

[package.dependencies]
mypy-extensions = ">=0.4.3"
tomli = {version = ">=1.1.0", markers = "python_version < \"3.11\""}
